Brazil's Soccer Cities

Sociopolitical Documentary hosted by Eric Camara and Silvia Salek and Rodrigo Pinto, published by BBC in 2014 - English narration


Information
------------------------------

Discover Brazil's World Cup cities through the eyes of the BBC's Brazilian reporters. The journalists give you the inside story on some of the country's most vibrant cities.

